import React from 'react'
import{
HeroContainer,
HeroBg,
HeroVideo
} from './HeroSectionElements'


const Hero = () => {
    return (
        <HeroContainer id="home">
            <HeroBg>
                <HeroVideo autoplay loop muted src="video"  type="video/  "/>
            </HeroBg>
        </HeroContainer>
    )
}

export default Hero;
